import React from "react";

const name = "Miantsa";
function App(){

    return (
        <>
            <h1>Bonjour {name}</h1>
            <h2>Bienvenu dans notre tutoriel React</h2>
            <p>React est un bibliotheque javascript</p>
        </>
    );
}

export default App;
